import "./App.css";
import "./index.css";
import posterOne from "./images/poster1.jpg";
import posterTwo from "./images/poster2.jpg";
import posterThree from "./images/poster3.jpg";
import { BrowserRouter as Router, Switch, Rout } from "react-router";

function App() {
  return (
    <div className="App">
      <div className="Images">
        <a href="#">
          <div>
            <img src={posterOne} alt="posterOne" />
            <h1>IO</h1>
          </div>
        </a>
        <a href="#">
          <div>
            <img src={posterTwo} alt="posterTwo" />
            <h1>The Green Knight</h1>
          </div>
        </a>
        <a href="#">
          <div>
            <img src={posterThree} alt="posterThree" />
            <h1>The Dry</h1>
          </div>
        </a>
      </div>
    </div>
  );
}

export default App;
